var canvas;
var ctx;

var img;
img = new Image();

window.onload = function(){
	canvas = document.createElement("canvas");
	ctx = canvas.getContext('2d');
	canvas.width = 800;
	canvas.height = 450;
	document.getElementById("selectfile").addEventListener("change", 
		function(evt){
			var file = evt.target.files;
			var reader = new FileReader();
			reader.readAsDataURL(file[0]);
			reader.onload = function(){
				img.src = reader.result;
			}
		},
	false);
}

function make(){
	canvas.width = 800;
	canvas.height = 450;
	DrawBox(0,0,800,450,GetColor(255,255,255));
	var cover = new Image();
	cover.onload = function(){
		ctx.rotate(-8.8*Math.PI/180);
		ctx.drawImage(img, 25, 222,115, 160 );
		ctx.rotate(8.8*Math.PI/180);
		ctx.drawImage(cover, 0, 0);
		document.getElementById("output").innerHTML = "<img src='" + canvas.toDataURL() + "'>";
	}
	cover.src = "data:image/png;base64,";
}

function GetColor(R,G,B){
	return "rgb("+R+","+G+","+B+")";
}
function DrawBox(x1, y1, x2, y2, color = GetColor(0,0,0), thickness = 0){
	if(thickness<=0){
		ctx.fillStyle = color;
		ctx.fillRect(x1,y1,x2-x1,y2-y1);
	}
	else{
		ctx.lineWidth = thickness;
		ctx.strokeStyle = color;
		ctx.strokeRect(x1,y1,x2-x1,y2-y1);
	}
}

